INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 1, 0, "リン", 10040, 0.0, 1, 24001, "あたしだって\nやるときはやるよ！");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 1, 1, "リン", 10040, 0.0, 1, 24002, "ふぅ…\nこれであたしの仕事は\n終わりだね");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 1, 2, "リン", 10040, 0.0, 1, 24003, "終わった終わった\n一人でもなんとか\nなるもんだね");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 2, 3, "リン", 10040, 0.0, 2, 24004, "やったね！\nこれでようやく\nサボれるよ…");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 1, 4, "リン", 10040, 0.0, 1, 24005, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 2, 5, "リン", 10040, 0.0, 2, 24006, "あたしを敵に回した\n恐ろしさ\n思い知ったか！");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 2, 6, "リン", 10040, 0.0, 2, 24007, "あたしも意外と\nやるもんでしょ？");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 4, 7, "リン", 10040, 0.0, 4, 24008, "疲れた…\nねずみの逃げ足\n速すぎるよ…");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 4, 8, "リン", 10040, 0.0, 4, 24009, "このままじゃ\nまっひ～に\n叱られちゃうよ");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 4, 9, "リン", 10040, 0.0, 4, 24010, "まじめに\nやったんだけどな…\n悔しいな～");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 4, 10, "リン", 10040, 0.0, 4, 24011, "やられた…\nねずみって意外と\nてごわいね");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 0.0, "2030/12/17 14:59:59", 24, 4, 11, "リン", 10040, 0.0, 4, 24012, "おのれ～\nあたしのチーズを\n盗みやがって～！");
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 102601, "2020/04/30 12:00:00", 1.81, "2030/12/17 14:59:59", 24, 1, 12, "リン", 10040, 0.0, 4, 24013, "疲れた…\nけど、次こそは\n守り抜くよ…");
